// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract UserRegistration {
    address public admin; // Admin address

    struct User {
        string name;
        string title; // Can be "Student", "Professor", etc.
        string phoneNumber;
        string email;
        bool isRegistered;
    }

    mapping(address => User) public users;

    modifier onlyAdmin() {
        require(msg.sender == admin, "Not authorized: Admin only");
        _;
    }

    event UserRegistered(address indexed userAddress, string name, string title, string email);

    constructor() {
        admin = msg.sender; // The deployer is the Admin
    }

    function registerUser(
        address _user,
        string memory _name,
        string memory _title,
        string memory _phoneNumber,
        string memory _email
    ) public onlyAdmin {
        require(!users[_user].isRegistered, "User already registered");

        users[_user] = User(_name, _title, _phoneNumber, _email, true);

        emit UserRegistered(_user, _name, _title, _email);
    }

    function getUser(address _user)
        public
        view
        returns (string memory, string memory, string memory, string memory, bool)
    {
        require(users[_user].isRegistered, "User not found");
        User memory u = users[_user];
        return (u.name, u.title, u.phoneNumber, u.email, u.isRegistered);
    }
}

